import React from "react";

type AttendanceCardProps = {
  headerText: string;
  bodyText: number | string;
  subBodyText: string;
};

const AttendanceCard = ({
  headerText,
  bodyText,
  subBodyText
}: AttendanceCardProps) => {
  return (
    <div>
      <h3>{headerText}</h3>
      <div>
        <span>{bodyText}</span>
        {subBodyText && <span>{subBodyText}</span>}
      </div>
    </div>
  );
};

export default AttendanceCard;
